// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/IERC721Metadata.sol"; // Importar a interface ERC721Metadata

contract GotasNFTMarketplace is Ownable, ReentrancyGuard, Pausable {
    struct Listing {
        address nftContractAddress;
        uint256[] nftIds; // Agora uma lista de IDs de token
        address seller;
        uint256[] prices; // PreÃ§os correspondentes
        uint256 deadline;
    }

    struct ListingInfo {
        uint256 listingId;
        uint256[] nftIds;
        string tokenMetadataLink;
    }

    uint256[] public activeListingIds;
    uint256 public royaltyPercentage;
    uint256 public platformFeePercentage;

    address public royaltyAddress;
    address public platformFeeAddress;

    mapping(uint256 => Listing) public listings;
    mapping(uint256 => address) public listingOwners;

    uint256 public nextListingId = 1;

    event NFTListed(uint256 indexed listingId, address indexed seller, address indexed nftContract, uint256[] nftIds, uint256[] prices, uint256 deadline);
    event NFTSold(uint256 indexed listingId, address indexed seller, address indexed buyer, uint256[] nftIds, uint256 totalPrice);
    event NFTDelisted(uint256 indexed listingId);

    constructor(uint256 _royaltyPercentage, uint256 _platformFeePercentage, address _royaltyAddress, address _platformFeeAddress) {
        require(_royaltyAddress != address(0) && _platformFeeAddress != address(0), "Addresses cannot be zero");
        royaltyPercentage = _royaltyPercentage;
        platformFeePercentage = _platformFeePercentage;
        royaltyAddress = _royaltyAddress;
        platformFeeAddress = _platformFeeAddress;
    }

    function listNFT(address _nftContractAddress, uint256[] memory _nftIds, uint256[] memory _prices, uint256 _deadline) external whenNotPaused nonReentrant {
        require(_nftIds.length > 0, "Must list at least one token.");
        require(_nftIds.length == _prices.length, "Token IDs and prices must have the same length.");
        require(_deadline > 0, "Deadline must be greater than zero.");

        IERC721 nftContract = IERC721(_nftContractAddress);

        for (uint256 i = 0; i < _nftIds.length; i++) {
            uint256 nftId = _nftIds[i];
            uint256 price = _prices[i];
            require(price > 0, "Price must be greater than zero.");
            require(nftContract.ownerOf(nftId) == msg.sender, "You must own the NFT to list it.");
        }

        listings[nextListingId] = Listing({
            nftContractAddress: _nftContractAddress,
            nftIds: _nftIds,
            seller: msg.sender,
            prices: _prices,
            deadline: block.timestamp + _deadline
        });

        listingOwners[nextListingId] = msg.sender;

        activeListingIds.push(nextListingId);

        emit NFTListed(nextListingId, msg.sender, _nftContractAddress, _nftIds, _prices, block.timestamp + _deadline);
        nextListingId++;
    }

    function buyNFT(uint256 _listingId) external payable whenNotPaused nonReentrant {
        require(msg.value > 0, "Sent value must be greater than zero.");

        Listing storage listing = listings[_listingId];
        require(listing.seller != address(0), "Listing does not exist.");
        require(block.timestamp <= listing.deadline, "This listing has expired.");

        uint256 totalPrice = 0;
        for (uint256 i = 0; i < listing.nftIds.length; i++) {
            uint256 nftId = listing.nftIds[i];
            totalPrice += listing.prices[i];

            require(msg.sender != listing.seller, "You cannot buy your own listings.");

            IERC721 nftContract = IERC721(listing.nftContractAddress);
            require(nftContract.ownerOf(nftId) == listing.seller, "Seller no longer owns the NFT.");

            nftContract.safeTransferFrom(listing.seller, msg.sender, nftId);
        }

        require(msg.value == totalPrice, "Sent value must be equal to the total price.");

        uint256 royaltyAmount = (totalPrice * royaltyPercentage) / 10000;
        uint256 platformFee = (totalPrice * platformFeePercentage) / 10000;
        uint256 sellerAmount = totalPrice - royaltyAmount - platformFee;

        payable(listing.seller).transfer(sellerAmount);
        payable(royaltyAddress).transfer(royaltyAmount);
        payable(platformFeeAddress).transfer(platformFee);

        emit NFTSold(_listingId, listing.seller, msg.sender, listing.nftIds, totalPrice);

        delete listings[_listingId];
        delete listingOwners[_listingId];
    }

    function cancelListing(uint256 _listingId) external nonReentrant {
        require(listingOwners[_listingId] == msg.sender, "Only the listing owner can cancel it.");

        delete listings[_listingId];
        delete listingOwners[_listingId];

        emit NFTDelisted(_listingId);
    }

    function pause() external onlyOwner nonReentrant {
        _pause();
    }

    function unpause() external onlyOwner nonReentrant {
        _unpause();
    }

    function updateFeeAddresses(address _newRoyaltyAddress, address _newPlatformFeeAddress) external onlyOwner nonReentrant {
        require(_newRoyaltyAddress != address(0) && _newPlatformFeeAddress != address(0), "Addresses cannot be zero");
        royaltyAddress = _newRoyaltyAddress;
        platformFeeAddress = _newPlatformFeeAddress;
    }

    function updateFeePercentages(uint256 _newRoyaltyPercentage, uint256 _newPlatformFeePercentage) external onlyOwner nonReentrant {
        royaltyPercentage = _newRoyaltyPercentage;
        platformFeePercentage = _newPlatformFeePercentage;
    }

    function getAllListingInfo() external view returns (ListingInfo[] memory) {
        ListingInfo[] memory allListingInfo = new ListingInfo[](activeListingIds.length);
        for (uint256 i = 0; i < activeListingIds.length; i++) {
            uint256 listingId = activeListingIds[i];
            Listing storage listing = listings[listingId];

            string memory tokenMetadataLink = "";

            try IERC721Metadata(listing.nftContractAddress).tokenURI(listing.nftIds[0]) returns (string memory metadataLink) {
                tokenMetadataLink = metadataLink;
            } catch {}

            allListingInfo[i] = ListingInfo({
                listingId: listingId,
                nftIds: listing.nftIds,
                tokenMetadataLink: tokenMetadataLink
            });
        }
        return allListingInfo;
    }
}

